import React, { useEffect, useState } from "react";
import { Text,TouchableOpacity } from "react-native";

const Product = ({ product }) => {
  return (
    <>
      <TouchableOpacity
        style={{color:"green"}}
        onPress={() => {
          //navigation.navigate("pruductDetails", { productid: product._id });
          console.log(product._id)
        }}
      >
        <Text>
          {product.name}
        </Text>
        <Text>
            {product.price}
        </Text>
        <Text>
            {product.rating}
        </Text>
      </TouchableOpacity>
      {console.log(product)}
    </>
  );
};

export default Product;
